select * from (select * from (select l_orderkey, sum(l_extendedprice*(1-l_discount)) as revenue, o_orderdate, o_shippriority
from (select * from lineitem where ((l_orderkey >= 2895301) AND (l_orderkey < 3783459)) OR ((l_orderkey >= 4755010) AND (l_orderkey < 5606625)) OR ((l_orderkey >= 9210565) AND (l_orderkey < 10101344)) OR ((l_orderkey >= 15624966) AND (l_orderkey < 16564609)) OR ((l_orderkey >= 22205543) AND (l_orderkey < 24133346)) OR ((l_orderkey >= 45876290) AND (l_orderkey < 46822821)) OR ((l_orderkey >= 52361255) AND (l_orderkey < 53389056)) OR ((l_orderkey >= 59113574) AND (l_orderkey < 60000001)) ) ll,
(select * from orders where ((o_orderkey >= 2807717) AND (o_orderkey < 3702725)) OR ((o_orderkey >= 4493698) AND (o_orderkey < 5435845)) OR ((o_orderkey >= 9100071) AND (o_orderkey < 10101444)) OR ((o_orderkey >= 15782241) AND (o_orderkey < 16599266)) OR ((o_orderkey >= 22230468) AND (o_orderkey < 24020263)) OR ((o_orderkey >= 46447623) AND (o_orderkey < 47383808)) OR ((o_orderkey >= 52387236) AND (o_orderkey < 53377792)) OR ((o_orderkey >= 59003719) AND (o_orderkey < 60000001)) ) oo,
(select * from customer where ((c_custkey >= 164917) AND (c_custkey < 188795)) OR ((c_custkey >= 279411) AND (c_custkey < 304966)) OR ((c_custkey >= 440249) AND (c_custkey < 460263)) OR ((c_custkey >= 508790) AND (c_custkey < 532854)) OR ((c_custkey >= 630895) AND (c_custkey < 677902)) OR ((c_custkey >= 702628) AND (c_custkey < 728661)) OR ((c_custkey >= 753129) AND (c_custkey < 774709)) OR ((c_custkey >= 819397) AND (c_custkey < 844022)) OR ((c_custkey >= 1317975) AND (c_custkey < 1341540)) ) cc
where c_mktsegment = 'BUILDING' and c_custkey = o_custkey and l_orderkey = o_orderkey and o_orderdate < '1995-03-15' and l_shipdate > '1995-03-15' group by l_orderkey, o_orderdate, o_shippriority) l2 order by revenue desc, o_orderdate) l1 limit 10;
